import React from "react";
import image1 from "./Images/Group 23.png";
import image2 from "./Images/Rectangle 3.png";


const styleFooterDiv1 = {
    width: "calc(100% - 240px)",
    backgroundImage: `url(${image2})`,
    overflow: "hidden",
    backgroundSize: "cover",
    backgroundRepeat: "no-repeat",
    backgroundPosition: "center",
    display: "flex",
    justifyContent: "space-around",
    alignItems: "center",
    marginRight: "auto",
    marginLeft: "auto"
};

const Footer = () => {
    return (
        <footer>
            <div className="footerDiv1" style={styleFooterDiv1}>
                <p>Стань профессионалом в веб-разработке</p>
                <a href="">
                    <button>Начать бесплатно</button>
                </a>
            </div>
            <div className="footerDiv2">
                <div className="foto1">
                    <img src={image1}/>
                </div>
                <div className="contacts">
                    <a href="">Контакты</a>
                    <a href="">Политика конфиденциальности</a>
                    <a href="">Условия предоставления услуг</a>
                </div>
            </div>
        </footer>
    );
}
export default Footer;
